			["actions"] = {
				["start"] = {
					["do_custom"] = true,
					["do_message"] = false,
					["custom"] = "UIParent:Hide();\naura_env.dumbFrame:SetAllPoints();\naura_env.dumbFrame:Show();\n\nSaveView(5)\n\nif aura_env.rotationDirection == 1 then\n    MoveViewLeftStart(aura_env.camTurnSpeed);\nelse\n    MoveViewRightStart(aura_env.camTurnSpeed);\nend\n\nif aura_env.config[\"fpView\"] then\n    SetView(1)\nend\n\nWeakAuras.ScanEvents(\"AFK_SCREEN\", true, aura_env.dumbFrame, aura_env.afk_config)\n--aura_env.region:SetColorRGB(1,0,0);\n--aura_env.region.color_r = 1\n\naura_env.region.subRegions[1]:SetBorderColor(\n    aura_env.afk_config[\"HighlightColor\"].r,\n    aura_env.afk_config[\"HighlightColor\"].g,\n    aura_env.afk_config[\"HighlightColor\"].b,\n    aura_env.afk_config[\"HighlightColor\"].a\n)\n\n\naura_env.print(\"AFK BG Show\")\n\n\n",
				},
				["init"] = {
					["custom"] = "--ViragDevTool_AddData(aura_env, \"foobar\")\n\nlocal function RGBPercToHex(r, g, b, a)\n    r = r <= 1 and r >= 0 and r or 0\n    g = g <= 1 and g >= 0 and g or 0\n    b = b <= 1 and b >= 0 and b or 0\n    a = a <= 1 and a >= 0 and a or 0\n    return string.format(\"%02x%02x%02x%02x\", r*255, g*255, b*255, a*255)\nend\n\naura_env.print = function(string)\n    --print(string)\nend\n\n-- Frame --\n-- Create a new frame for the aura so it isn't parented to the UIParent region\n-- This allows us to hide all of UIParent and only show what is relevant to this aura\naura_env.createDumbFrame = function()\n    aura_env.dumbFrame = dumbFrame\n    if not aura_env.dumbFrame then\n        aura_env.dumbFrame = CreateFrame(\"Frame\", \"dumbFrame\");\n    end\n    aura_env.dumbFrame:SetScale(UIParent:GetScale())\n    aura_env.dumbFrame:SetAllPoints();\n    return aura_env.dumbFrame\nend\n\naura_env.createDumbFrame()\n\n-- Global aura configs --\n-- Configs that should be applied to all auras of the  AFK screen group.\n-- I.E. Only have one checkbox for 'Use class color' in custom settings and have\n-- it apply to all auras\n\n-- Highlight color\naura_env.afk_config = {\"HighlightColor\"}\n\naura_env.afk_config[\"HighlightColor\"] = {}\naura_env.afk_config[\"HighlightColor\"].a = 1;\naura_env.afk_config[\"HighlightColor\"].r = 1;\naura_env.afk_config[\"HighlightColor\"].g = 1;\naura_env.afk_config[\"HighlightColor\"].b = 1;\naura_env.afk_config[\"HighlightColor\"].colorStr = \"FFFFFFFF\";\n\naura_env.afk_config[\"HighlightColor\"].r = aura_env.config[\"highlightColor\"][1]\naura_env.afk_config[\"HighlightColor\"].g = aura_env.config[\"highlightColor\"][4]\naura_env.afk_config[\"HighlightColor\"].b = aura_env.config[\"highlightColor\"][3]\naura_env.afk_config[\"HighlightColor\"].a = aura_env.config[\"highlightColor\"][4]\naura_env.afk_config[\"HighlightColor\"].colorStr = RGBPercToHex(\n    aura_env.config[\"highlightColor\"][1],\n    aura_env.config[\"highlightColor\"][2],\n    aura_env.config[\"highlightColor\"][3],\n    aura_env.config[\"highlightColor\"][4])\n\nif aura_env.config[\"useClassColor\"] then\n    local classFilename, classId = UnitClassBase(\"player\");\n    \n    aura_env.afk_config[\"HighlightColor\"].a = 1;\n    aura_env.afk_config[\"HighlightColor\"].r = RAID_CLASS_COLORS[classFilename].r;\n    aura_env.afk_config[\"HighlightColor\"].g = RAID_CLASS_COLORS[classFilename].g;\n    aura_env.afk_config[\"HighlightColor\"].b = RAID_CLASS_COLORS[classFilename].b;\n    aura_env.afk_config[\"HighlightColor\"].colorStr = RAID_CLASS_COLORS[classFilename].colorStr;\nend\n\naura_env.region.subRegions[1]:SetBorderColor(\n    aura_env.afk_config[\"HighlightColor\"].r,\n    aura_env.afk_config[\"HighlightColor\"].g,\n    aura_env.afk_config[\"HighlightColor\"].b,\n    aura_env.afk_config[\"HighlightColor\"].a\n)\n\n-- Camera setup --\naura_env.camTurnSpeed = aura_env.config[\"camTurnSpeed\"]/tonumber(GetCVar(\"cameraYawMoveSpeed\"));\n\naura_env.rotationDirection = aura_env.config[\"rotationDirection\"];\nif aura_env.rotationDirection == 3 then --Random\n    aura_env.rotationDirection = math.random(2);\nend\n\n-- Forced exit --\n-- When running the aura and 'ESC' or other  keys are pushed,\n-- UIParent will sometimes show without clearing the AFK flagon the player\n-- In order to keep the aura neet, we forcefully quick the aura if UIParent is shown\nUIParent:HookScript(\"OnShow\", function()\n        WeakAuras.ScanEvents(\"AFK_SCREEN_FORCE_QUIT\") \n        --C_Timer.After(5, function() WeakAuras.ScanEvents(\"AFK_SCREEN_FORCE_START\")  end)\nend)\n\n-- /run WeakAuras.ScanEvents(\"TRIGGER_MY_AURA\")\n\naura_env.forcedQuit = false;\naura_env.inAH = false;\naura_env.inTradeSkill = false;\n\naura_env.printcvar = function (name)\n    local value, defaultValue, account, character, unknown5, setCvarOnly, readOnly = GetCVarInfo(name)\n    --print(name..\": \" .. tostring(value))\nend\n\naura_env.printallcvar = function (label)\n    --print(\"------- \"..label..\" ------------\")\n    aura_env.printcvar(\"cameraView\")\n    aura_env.printcvar(\"camerasmooth\")\n    aura_env.printcvar(\"cameraSmoothPitch\")\n    aura_env.printcvar(\"cameraSmoothStyle\")\n    aura_env.printcvar(\"cameraSmoothTrackingStyle\")\n    aura_env.printcvar(\"cameraSmoothYaw\")\n    aura_env.printcvar(\"cameraSmoothTimeMin\")\n    aura_env.printcvar(\"cameraSmoothTimeMax\")\n    aura_env.printcvar(\"cameraYawSmoothSpeed\")\n    aura_env.printcvar(\"cameraYawMoveSpeed\")\n    --print(\"------- \"..label..\" ------------\")\n    \nend\n\naura_env.printallcvar(\"init\")\naura_env.print(\"AFK BG Init\")\n\n--C_Timer.After(10, function() print(\"RESET\") ResetView(5) end)",
					["do_custom"] = true,
				},
				["finish"] = {
					["custom"] = "WeakAuras.ScanEvents(\"AFK_SCREEN\", false)\nMoveViewRightStart(0);\nMoveViewLeftStart(0);\nUIParent:Show();\n\nif aura_env.config[\"fpView\"] or aura_env.config[\"resetCamera\"] then\n    SetView(5)\nend\n\nlocal value, defaultValue, account, character, unknown5, setCvarOnly, readOnly = GetCVarInfo(\"cameraSmoothStyle\")\n-- Always reset view when camera config set to auto center on player\nif value ~= \"0\" then\n    ResetView(5)\nend\n\n\n--SetCVar(\"cameraSmoothStyle\", 4)\n--SetCVar(\"cameraSmoothStyle\", 1)\n\naura_env.printallcvar(\"end\")\n\n\n",
